import { Data, Params } from 'src/request/entity.d';
import { post, get, upload } from "src/request/api"

// 查询限时任务列表
export const timingTasks = (data: Data) => {
 return get('/api/v1/app/timing/query-timing-tasks', data)
}
// 查询限时任务详情
export const taskDetail = (data: Data) => {
 return get('/api/v1/app/timing/task-detail', data)
}
// 查询我的限时任务详情
export const myTaskDetail = (data: Data) => {
 return get('/api/v1/app/timing/my-task-detail', data)
}
// 拿到限时任务
export const obtainTimingTask = (data: Data) => {
 return get('/api/v1/app/timing/obtain-timing-task', data)
}
// 确认完成限时任务
export const ackTimingTask = (data: Data) => {
 return get('/api/v1/app/timing/ack-timing-task', data)
}
// 取消任务
export const cancelTask = (data: Data) => {
 return get('/api/v1/app/timing/cancel-task', data)
}
// 查询限时任务记录
export const historyTasks = (data: Data) => {
 return get('/api/v1/app/timing/query-timing-history-tasks', data)
}

// 上传图片
export const uploadImg = (data: any) => {
 return upload('/index/redlists/file/upload', data)
}
